window.bookSummaryJSON = "<p>The crew of a WWII destroyer face their greatest challenge yet as they try to survive in a strange new world in the next thrilling book in <i>The New York Times</i> best-selling series.</p> <p>Commander Matt Reddy and his crew are afraid it may finally be the end of the USS <i>Walker</i>. Ever since their ship was transported to another world, and they became embroiled in a deadly conflict between the Lemurians and the vicious Grik, the <i>Walker </i>has been taking a pounding. With <i>Walker </i>out of commission for repairs, Reddy takes command of a different ship and joins a desperate battle to block the Grik swarm.</p> <p>Meanwhile, the humans and their allies face a deadly second front in the Republic to the south. All of Reddy's forces are committed, and there's no turning back. Either they'll win - or lose - everything....</p>"; 
